(1, 1946371701, 'Nov 17, 2016 12:55 AM', '    After multiple requests we have not received a response to this case. Because you have not responded, we assume that your issue has been resolved. We have now closed this case.                        If this issue is not resolved, you can reopen this case to provide the requested information.This is an automated message.To respond to this message, please visit:http://sellercentral.amazon.com/gp/contact-us/contact-amazon-form.html?caseID=1946371701Thank you!Amazon Seller SupportPlease let us know how we did.Were you satisfied with the support provided?  Click here for yes: https://sellercentral.amazon.com/hz/case-dashboard/hmd?p=A1E653R6OKVJTT&c=1946371701&k=hyClick here for no: https://sellercentral.amazon.com/hz/case-dashboard/hmd?p=A1E653R6OKVJTT&c=1946371701&k=hn  Thank you! To view your case details, or respond, please click http://sellercentral.amazon.com/gp/case-dashboard/view-case.html/ref=sc_cd_lobby_vc?caseID=1946371701Please note: this e-mail was sent from an address that cannot accept incoming e-mail. If you require additional support please contact us https://sellercentral.amazon.com/hz/contact-us ---- Original message ---- Dear Seller,Thank you for contacting Amazon Seller Support.From the content of your email, I understand that you want to change the category of the ASIN  B01LMJ4QYI to ''Toys and Games''Upon checking our internal tools, I see that the present category of the ASIN B01LMJ4QYI is ''Toys & Games › Novelty & Gag Toys › Slime & Putty Toys''Kindly let us know if this is the exact category which you want your product to be placed in.I am sorry for making you take an additional step regarding this issue but it is just to ensure that we provide you with the best possible resolution.Also, I would like to inform you that as per policy, this case, once replied by us, will be open only for the next 3 business days and will then be assigned to auto closure.However, you may contact us regarding this issue