(4, 1946373971, 'Nov 15, 2016 01:03 AM', '\n    Greetings John,\n    \n        \n            Thank you for writing to Amazon seller support. I hope this email finds you well.I am Kritika and I will be assisting you today. I understand that you would like us to assign the ASIN: B01LMJ4R10 under the category ''toys and games'' as it is incorrectly categorized under ''apparel''.I would like to inform you that I have gone ahead and updated the category as ''toys and games'' for the ASIN:B01LMJ4R10. The same is reflecting on the detail page. The reason as to why the category was showing as ''apparel'' was because the item was incorrectly categorized as a costume. However the issue has been fixed now. Kindly view the link and screenshot attached to verify the changes.https://www.amazon.com/dp/B01LMJ4R10I hope this helps. Kindly clear the cache and cookies before you verify the changes.Should you notice any discrepancy in the future on any of the details on an Amazon detail page, please do not hesitate to open a new case and let us know. We will always be there to assist you.Thank you for your patience and understanding in this regard.Below, you will have the opportunity to complete a survey based on the assistance you have received for this case. You will also have the opportunity to provide a comment regarding the service provided. We sincerely appreciate your time in doing this, and have a wonderful day! Wish you all success in business and a good health.Please let us know how we did.Were you satisfied with the support provided?  Click here for yes: https://sellercentral.amazon.com/hz/case-dashboard/hmd?p=A2R77Q6G9SDI5N&c=1946373971&k=hyClick here for no: https://sellercentral.amazon.com/hz/case-dashboard/hmd?p=A2R77Q6G9SDI5N&c=1946373971&k=hn  Thank you! To view your case details, or respond, please click http://sellercentral.amazon.com/gp/case-dashboard/view-case.html/ref=sc_cd_lobby_vc?caseID=1946373971Please note: this e-mail was sent from an address that cannot accept incoming e-mail. If you require additional support please contact us https://sellercentral.amazon.com/hz/contact-usTo see the file named ''"Toys and games.png"'' included with this correspondence, please use the Seller Central case link given below the signature.Your Current Notifications----------------------------------------"SmartLife Outdoor Sports Climbing Folding Carabiner Grappling Hook Three Claws Stainless Steel Foldable" is on customer wish lists but has few active offers.Take advantage of this opportunity by offering this product to customers.Create an offer for this ASIN (B01F38J3KG)https://catalog.amazon.com/abis/Display/ItemSelected?asin=B01F38J3KG&iris_notification_id=d198165233b58decc96158f0dbfcd661----------------------------------------Thank you for selling with Amazon,Kritika P.Amazon.com Seller Support=======================================MORE WAYS TO GET HELP:Visit our Seller Forums for help from other sellers: http://sellercentral.amazon.com/forumsBrowse all Seller Help topics: http://sellercentral.amazon.com/gp/helpTo contact us again about this issue, please use the Contact Us form in Seller Central using the following link:http://sellercentral.amazon.com/gp/contact-us/contact-amazon-form.html?caseID=1946373971Please note: this e-mail was sent from a notification-only address that cannot accept incoming e-mail. Please do not reply to this message.\n            \n                \n                Attachments:\n        \n            Toys and games.png\n            \n        \n        \n            See less\n        \n    \n', '2017-01-20 17:17:29'),
