(7, 1946375911, 'Nov 14, 2016 11:12 PM', '\n    Greetings Seller,\n    \n        \n            This is Kenneth from Amazon Catalog Corrections team and I will be assisting you today.I understand that you want us to correct the category of the ASIN: B01LMJ4R06 to Toys & Games. I have reviewed the ASIN: B01LMJ4R06 in our catalog and was able to confirm that the product is incorrectly listed under Clothing & Accessories category. However, I have now changed the category of this listing from Clothing & Accessories to Toys & Games category as per your suggestion. Kindly allow about 24 hours for the changes to reflect on the detail page. Your kind understanding in this regard is much appreciated.I would like to thank you for taking the time and sending in your request regarding category change for ASIN B01LMJ4R06. We are glad because it is sellers like you who help us in keeping our catalog accurate and buyer friendly.It has been a pleasure serving you today. We strive to provide the best customer service we can and your feedback is key to letting us know how we’re doing. Can I ask you to take a brief survey below and share your feedback with us?Please let us know how we did.Were you satisfied with the support provided?  Click here for yes: https://sellercentral.amazon.com/hz/case-dashboard/hmd?p=A3RUT9YVWZ2LTS&c=1946375911&k=hyClick here for no: https://sellercentral.amazon.com/hz/case-dashboard/hmd?p=A3RUT9YVWZ2LTS&c=1946375911&k=hn  Thank you! To view your case details, or respond, please click http://sellercentral.amazon.com/gp/case-dashboard/view-case.html/ref=sc_cd_lobby_vc?caseID=1946375911Please note: this e-mail was sent from an address that cannot accept incoming e-mail. If you require additional support please contact us https://sellercentral.amazon.com/hz/contact-usYour Current Notifications----------------------------------------Based on your sales and current demand, you may run out of "Post-it® Notes, Original Pad, 3 Inches x 3 Inches, Assorted Neon Colors,